r\ndnech panovaly v Jihoafrické republice extrémně horké podmínky. To se ale\r\nzměnilo v dnešní šesté etapě, když po celou dobu závodu bylo zataženo.\r\nZávodníci dokonce dojížděli do cíle špinaví od bláta. Tyto podmínky nejvíce\r\nsedly jihoafrické dvojici Joubert a Nortje, která získala své první vítězství\r\nna letošním Cape Epic.</b></p>\r\n\r\n<p class=\"MsoNormal\">Před podrobnějším popisem šesté etapy se ale podíváme na to,\r\nco se událo několik hodin před startem. Tým Buff Megamo totiž oznámil, že\r\ndvojice <b style=\"mso-bidi-font-weight:normal\">Martin Stošek a Wout Alleman\r\nnenastoupí do předposledního dne závodu</b>. Důvodem by měly být Belgičanovy žaludeční\r\nproblémy. Česko-belgická dvojice tak závod opustila z průběžně páté příčky<b style=\"mso-bidi-font-weight:normal\">. Z Afriky si tento tým nakonec odváží\r\njedno etapové vítězství a jedno třetí místo.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/p/DHfQ16-oyoB/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/p/DHfQ16-oyoB/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"> <div style=\" display: flex; flex-direction: row; align-items: center;\"> <div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center;\"> <div style=\" backgro