px) translateY(-4px) rotate(30deg)\"></div></div><div style=\"margin-left: auto;\"> <div style=\" width: 0px; border-top: 8px solid #F4F4F4; border-right: 8px solid transparent; transform: translateY(16px);\"></div> <div style=\" background-color: #F4F4F4; flex-grow: 0; height: 12px; width: 16px; transform: translateY(-4px);\"></div> <div style=\" width: 0; height: 0; border-top: 8px solid #F4F4F4; border-left: 8px solid transparent; transform: translateY(-4px) translateX(8px);\"></div></div></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center; margin-bottom: 24px;\"> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 224px;\"></div> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 144px;\"></div></div></a><p style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; line-height:17px; margin-bottom:0; margin-top:8px; overflow:hidden; padding:8px 0 7px; text-align:center; text-overflow:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/reel/DHfwDKeIuz6/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">Příspěvek sdílený Cape Epic (@capeepic)</a></p></div></blockquote> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">V cíli se tak\r\nradovali z vítězství Jihoafričané Joubert a Nortje</b>, kteří do cíle dorazili 14\r\nsekund před Avondettem a Braidotem. Třetí do cíle dorazila švýcarská dvojice\r\nSchurter a Colomobo, kteří na vítěze ztratili 1min 34s. Ale i <b style=\"mso-bidi-font-weight:normal\">to Švýcarům z týmu Scott Sram stačilo na\r\nudržení celkové vedení</b>. Jejich náskok na Italy se ale ztenčil na pouhých <b style=\"mso-bidi-font-weight:normal\">32 sekund, tudíž vše rozhodne až zítřejší\r\nzávěrečná etapa</b>. Celkově třetí Jihoafričané mají před sebou i za sebou více\r\njak desetiminutovou mezeru.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Letošní ročník zatím mezi ženami <b style=\"mso-bidi-font-weight:\r\nnormal\">patřil dvojici Annika Langvad a Sofia Gomez Villafane</b>. Dnešek byl\r\nale výjimkou, jelikož poprvé v tomto ročníku tato dvojice nezvítězila, ale\r\nskončila až na druhém místě. Z <b style=\"mso-bidi-font-weight:normal\">vítězství\r\nse v šesté etapě radoval tým Cannondale</b> ve složení Monica Y.C. Martinez a\r\nTessa Kortekaas. Třetí místo dnes ukořistila jihoafrická dvojice Haw a Preen.<img src=\"data:image/png;base64,\" alt=\"\"></p><p class=\"MsoNormal\">Kompletní výsledky naleznete <b><a href=\"https://my.raceresult.com/329222/results#1_E7E3F0\" target=\"_blank\">ZDE</a></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Kdo podle Vás vyhraje\r\nletošní Cape Epic?</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p><p class=\"MsoNormal\">zdroj úvodní fotografie: facebook.com/profile.php?id=100060685488032 <br></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p>\r\n\r\n<div><br></div>', 6, 'stosek-s-allemanem-predcasne-opousti-cape-epic-ze-zdravotnich-duvodu');
INSERT INTO `clanky` (`id`, `nazev`, `datum`, `viditelnost`, `nahled_foto`, `obsah`, `user_id`, `url`) VALUES
(809, 'Fenomenální závodění s dechberoucím koncem! Mathieu van der Poel znovu ovládl Milano-Sanremo!', '2025-03-22 16:52:00', 1, 'GmqAvlVa4AAgasE.jpg', '\r\n        Už teď je jasné, že tohle byl<b> jeden z nejnapínavějších a divácky nejzajímavějších závodů sezóny!</b> Přitom kdo by to byl řekl, že? <b>Vždyť je to Milano-Sanremo!</b> To by tu ale nesměl být <b>Tadej Pogačar</b>, který rozpoutal fenomenální bitvu s Mathieu van der Poelem a Filippem Gannou. Závěrečných <b>30 km plných nekončících útoků</b> ovládl Mathieu van der Poel <b>až na cílové rovince Via Roma ve sprintu</b>. Za ním dorazil jako druhý<b> Filippo Ganna</b> a ihned po něm <b>Tadej Pogačar</b>. Van der Poel tak má na kontě již<b> druhé vítězství z tohoto monumentu</b>, zatímco Pogačar si opět odváží jen <b>hořkost a pocit marnosti</b>.<div><font face=\"Fira Sans Condensed, sans-serif\"><br></font></div><div><font face=\"Fira Sans Condensed, sans-serif\"><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/JZ4pNeZWKoM?si=MS_0crll-sDiDN6w\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></font><div><br></div><div><b>289 km</b> 116. edice prvního monumentu sezóny odstartovalo<b> v šíleném dešti</b>. Možná i touha závodníků o zahřátí vybudila<b> sérii útoků a pokusů o únik</b>. To se po chvíli 8 závodníkům povedlo. Jejich náskok ale za celý závod nenarostl na více než<b> 6 minut</b>, jelikož na čele pelotonu pracoval tým<b> Alpecin-Deceuninck</b> a zejména&nbsp;<b>Silvan Dillier</b>, který fantasticky pracoval pro <b>Mathieu van der Poela a Jaspera Philipsena</b> a na čele strávil <b>přes 200 km</b>. Ze špice slezl až před začátkem stoupání <b>Capo Mele</b>, kde štafetu převzal <b>Geraint Thomas </b>z Ineosu.&nbsp;Na únik v tu chvíli chybělo asi dvě a půl minuty.</div><div><br></div><div>Ve stoupání začali jezdci z balíku <b>postupně</b> <b>odpadat</b>, jelikož na čelo postupně najel tým <b>UAE Emirates - XRG</b>, aby vytvořil pracovní podmínky pro Tadeje Pogačara. To pro únik znamenalo konečnou. Posledním, kdo byl pohlcen, byl&nbsp;Marcellusi, který zvládl dojet osamoceně <b>až pod Cipressu</b>. V tu chvíli Tim Wellens z UAE rozjel takové tempo, že kromě většiny balíku a sprinterů, jako je Philipsen,<b> vyřadil i většinu Pogačarova týmu</b>. Posledním, kdo vydržel na čele udávat tempo byl <b>Jonathan Narvaez</b>, který po chvíli uhnul a přišlo to, na co všichni čekali -<b> Tadejův útok</b>. Ten byl tak brutální, že na dlouhém táhlém stoupání vydržel v háku jen Van der Poel s Gannou.<b> Slovinec střídavě útočil a zvolňoval</b>, aby následně ve sjezdu jeli všichni tři opět po hromadě a spolupracovali.</div><div><br></div><div><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/reel/DHgctyJItVc/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/reel/DHgctyJItVc/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"> <div style=\" display: flex; flex-direction: row; align-items: center;\"> <div style=\"background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 40px; margin-right: 14px; width: 40px;\"></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center;\"> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 100px;\"></div> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 60px;\"></div></div></div><div style=\"padding: 19% 0;\"></div> <div style=\"display:block; height:50px; margin:0 auto 12px; width:50px;\"><svg width=\"50px\" height=\"50px\" viewBox=\"0 0 60 60\" version=\"1.1\" xmlns=\"https://www.w3.org/2000/svg\" xmlns:xlink=\"https://www.w3.org/1999/xlink\"><g stroke=\"none\" stroke-width=\"1\" fill=\"none\" fill-rule=\"evenodd\"><g transform=\"translate(-511.000000, -20.000000)\" fill=\"#000000\"><g><path d=\"M556.869,30.41 C554.814,30.41 553.148,32.076 553.148,34.131 C553.148,36.186 554.814,37.852 556.869,37.852 C558.924,37.852 560.59,36.186 560.59,34.131 C560.59,32.076 558.924,30.41 556.869,30.41 M541,60.657 C535.114,60.657 530.342,55.887 530.342,50 C530.342,44.114 535.114,39.342 541,39.342 C546.887,39.342 551.658,44.114 551.658,50 C551.658,55.887 546.887,60.657 541,60.657 M541,33.886 C532.1,33.886 524.886,41.1 524.886,50 C524.886,58.899 532.1,66.113 541,66.113 C549.9,66.113 557.115,58.899 557.115,50 C557.115,41.1 549.9,33.886 541,33.886 M565.378,62.101 C565.244,65.022 564.756,66.606 564.346,67.663 C563.803,69.06 563.154,70.057 562.106,71.106 C561.058,72.155 560.06,72.803 558.662,73.347 C557.607,73.757 556.021,74.244 553.102,74.378 C549.944,74.521 548.997,74.552 541,74.552 C533.003,74.552 532.056,74.521 528.898,74.378 C525.979,74.244 524.393,73.757 523.338,73.347 C521.94,72.803 520.942,72.155 519.894,71.106 C518.846,70.057 518.197,69.06 517.654,67.663 C517.244,66.606 516.755,65.022 516.623,62.101 C516.479,58.943 516.448,57.996 516.448,50 C516.448,42.003 516.479,41.056 516.623,37.899 C516.755,34.978 517.244,33.391 517.654,32.338 C518.197,30.938 518.846,29.942 519.894,28.894 C520.942,27.846 521.94,27.196 523.338,26.654 C524.393,26.244 525.979,25.756 528.898,25.623 C532.057,25.479 533.004,25.448 541,25.448 C548.997,25.448 549.943,25.479 553.102,25.623 C556.021,25.756 557.607,26.244 558.662,26.654 C560.06,27.196 561.058,27.846 562.106,28.894 C563.154,29.942 563.803,30.938 564.346,32.338 C564.756,33.391 565.244,34.978 565.378,37.899 C565.522,41.056 565.552,42.003 565.552,50 C565.552,57.996 565.522,58.943 565.378,62.101 M570.82,37.631 C570.674,34.438 570.167,32.258 569.425,30.349 C568.659,28.377 567.633,26.702 565.965,25.035 C564.297,23.368 562.623,22.342 560.652,21.575 C558.743,20.834 556.562,20.326 553.369,20.18 C550.169,20.033 549.148,20 541,20 C532.853,20 531.831,20.033 528.631,20.18 C525.438,20.326 523.257,20.834 521.349,21.575 C519.376,22.342 517.703,23.368 516.035,25.035 C514.368,26.702 513.342,28.377 512.574,30.349 C511.834,32.258 511.326,34.438 511.181,37.631 C511.035,40.831 511,41.851 511,50 C511,58.147 511.035,59.17 511.181,62.369 C511.326,65.562 511.834,67.743 512.574,69.651 C513.342,71.625 514.368,73.296 516.035,74.965 C517.703,76.634 519.376,77.658 521.349,78.425 C523.257,79.167 525.438,79.673 528.631,79.82 C531.831,79.965 532.853,80.001 541,80.001 C549.148,80.001 550.169,79.965 553.369,79.82 C556.562,79.673 558.743,79.167 560.652,78.425 C562.623,77.658 564.297,76.634 565.965,74.965 C567.633,73.296 568.659,71.625 569.425,69.651 C570.167,67.743 570.674,65.562 570.82,62.369 C570.966,59.17 571,58.147 571,50 C571,41.851 570.966,40.831 570.82,37.631\"></path></g></g></g></svg></div><div style=\"padding-top: 8px;\"> <div style=\" color:#3897f0; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:550; line-height:18px;\">Zobrazit příspěvek na Instagramu</div></div><div style=\"padding: 12.5% 0;\"></div> <div style=\"display: flex; flex-direction: row; margin-bottom: 14px; align-items: center;\"><div> <div style=\"background-color: #F4F4F4; border-radius: 50%; height: 12.5px; width: 12.5px; transform: translateX(0px) translateY(7px);\"></div> <div style=\"background-color: #F4F4F4; height: 12.5px; transform: rotate(-45deg) translateX(3px) translateY(1px); width: 12.5px; flex-grow: 0; margin-right: 14px; margin-left: 2px;\"></div> <div style=\"background-color: #F4F4F4; border-radius: 50%; height: 12.5px; width: 12.5px; transform: translateX(9px) translateY(-18px);\"></div></div><div style=\"margin-left: 8px;\"> <div style=\" background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 20px; width: 20px;\"></div> <div style=\" width: 0; height: 0; border-top: 2px solid transparent; border-left: 6px solid #f4f4f4; border-bottom: 2px solid transparent; transform: translateX(16px) translateY(-4px) rotate(30deg)\"></div></div><div style=\"margin-left: auto;\"> <div style=\" width: 0px; border-top: 8px solid #F4F4F4; border-right: 8px solid transparent; transform: translateY(16px);\"></div> <div style=\" background-color: #F4F4F4; flex-grow: 0; height: 12px; width: 16px; transform: translateY(-4px);\"></div> <div style=\" width: 0; height: 0; border-top: 8px solid #F4F4F4; border-left: 8px solid transparent; transform: translateY(-4px) translateX(8px);\"></div></div></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center; margin-bottom: 24px;\"> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 224px;\"></div> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 144px;\"></div></div></a><p style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; line-height:17px; margin-bottom:0; margin-top:8px; overflow:hidden; padding:8px 0 7px; text-align:center; text-overflow:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/reel/DHgctyJItVc/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">Příspěvek sdílený Milano Sanremo (@milanosanremo_)</a></p></div></blockquote> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></div><div><br></div><div>Pak přišlo poslední a nejtěžší stoupání dne - <b>Poggio</b>. Pogi samozřejmě opět zaútočil a tentokrát dokázal vyřadit alespoň Gannu. <b>Van der Poel byl ale jako přilepený. </b>Následovala tak série několika útoků, při kterých <b>jeli opravdu na limitu oba dva</b>. Výsledkem ale nebylo nic jiného, než to, že dole pod kopcem byli opět spolu a 7 vteřin za sebou vezli Gannu. O vítězi tak měl rozhodnout sprint.</div><div><br></div><div>Ten <b>sedl nejlépe Nizozemci</b>, když dost možná ze strachu z přílišné taktizace zahájil svůj pokus<b> 300 metrů před cílovou páskou</b>, a dojel si pro své <b>druhé vítězství tohoto monumentu</b> v kariéře. Ganna ho dotáhnout nedokázal a Pogačar zůstal příliš vzadu na to, aby měl větší šanci.</div><div><br></div><div><p></p><div class=\"iframe\"><blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"it\" dir=\"ltr\">🔻 Breathtaking. Possibly the greatest 1000m we\'ve seen on la Via Roma.<br><br>🔻 Mozzafiato. Forse il più grande 1000m che abbiamo visto sulla Via Roma.<br><br>⏪ The <a href=\"https://twitter.com/continentaltire?ref_src=twsrc%5Etfw\">@continentaltire</a> Ultimo Kilometro ⤵️<a href=\"https://twitter.com/hashtag/MilanoSanremo?src=hash&amp;ref_src=twsrc%5Etfw\">#MilanoSanremo</a> presented by <a href=\"https://twitter.com/CA_Ita?ref_src=twsrc%5Etfw\">@CA_Ita</a> <a href=\"https://t.co/u6E2ZMt5ZX\">pic.twitter.com/u6E2ZMt5ZX</a></p>— Milano Sanremo (@Milano_Sanremo) <a href=\"https://twitter.com/Milano_Sanremo/status/1903476874723922097?ref_src=twsrc%5Etfw\">March 22, 2025</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script></div><br></div><div><br></div><div><div>„Je těžké tomu věřit. Soustředil jsem se na vítězství, ale všichni jsme věděli, že Tadej bude opravdu silný. Na konci jsem se cítil opravdu dobře.<b> Začátek byl s tím deštěm a zimou hrozný</b>, ale když jsme sjeli na pobřeží, bylo to lepší. Je to třetí rok v řadě, co jsme tu s týmem vyhráli, takže<b> je to skvělé a hlavně ojedinělé</b>. Věděl jsem, že Tadej je ve stoupáních nejsilnější. Už na Cipresse byl působivý. Navíc spolupráce byla docela dobrá, takže jsme si <b>díky ní vyjeli umístění na stupních vítězů</b>. Na vrcholu Poggia jsem samozřejmě věděl, že se mě Tadej pokusí urvat, ale <b>cítil jsem se sebevědomě</b>. Doufal jsem, že se mi pak podaří kontrovat a zkusil mu <b>ucuknout taky</b>, ale on byl dost silný na to, aby mě chytil,\" zhodnotil průběh závodu Van der Poel.</div><div><br></div><div>K samotnému sprintu se pak vyjádřil takto: „Věděl jsem, že ti dva chtějí <b>jet na dlouhý sprint</b>. Asi si mysleli, že já chci co nejkratší, takže jsem je trochu překvapil. Když jsem viděl značku <b>300 metrů</b>, rozjel jsem to a zvládl to udržet až do cíle.“</div><div><br></div><div>Z Pogačarovy perspektivy to pak vypadalo takto: „Zanalyzujeme to a uvidíme, co bylo špatně. Ale už teď můžu říct, že jsme <b>zajeli opravdu dobrý závod</b>. Z mého pohledu to tak bylo a snažili jsme se udělat všechno pro to, aby byl závod opravdu těžký, ale nestačilo to. Dnes tu <b>holt byli dva lepší jezdci</b>. Příští rok je tu ale další šance!“</div><div><br></div><div><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/reel/DHggsHUo1IT/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/reel/DHggsHUo1IT/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-decoration:none; width:100%;\" target=\"_blank\"> <div style=\" display: flex; flex-direction: row; align-items: center;\">