ckground-color: #F4F4F4; border-radius: 50%; height: 12.5px; width: 12.5px; transform: translateX(0px) translateY(7px);\"></div> <div style=\"background-color: #F4F4F4; height: 12.5px; transform: rotate(-45deg) translateX(3px) translateY(1px); width: 12.5px; flex-grow: 0; margin-right: 14px; margin-left: 2px;\"></div> <div style=\"background-color: #F4F4F4; border-radius: 50%; height: 12.5px; width: 12.5px; transform: translateX(9px) translateY(-18px);\"></div></div><div style=\"margin-left: 8px;\"> <div style=\" background-color: #F4F4F4; border-radius: 50%; flex-grow: 0; height: 20px; width: 20px;\"></div> <div style=\" width: 0; height: 0; border-top: 2px solid transparent; border-left: 6px solid #f4f4f4; border-bottom: 2px solid transparent; transform: translateX(16px) translateY(-4px) rotate(30deg)\"></div></div><div style=\"margin-left: auto;\"> <div style=\" width: 0px; border-top: 8px solid #F4F4F4; border-right: 8px solid transparent; transform: translateY(16px);\"></div> <div style=\" background-color: #F4F4F4; flex-grow: 0; height: 12px; width: 16px; transform: translateY(-4px);\"></div> <div style=\" width: 0; height: 0; border-top: 8px solid #F4F4F4; border-left: 8px solid transparent; transform: translateY(-4px) translateX(8px);\"></div></div></div> <div style=\"display: flex; flex-direction: column; flex-grow: 1; justify-content: center; margin-bottom: 24px;\"> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; margin-bottom: 6px; width: 224px;\"></div> <div style=\" background-color: #F4F4F4; border-radius: 4px; flex-grow: 0; height: 14px; width: 144px;\"></div></div></a><p style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; line-height:17px; margin-bottom:0; margin-top:8px; overflow:hidden; padding:8px 0 7px; text-align:center; text-overflow:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/reel/DHggsHUo1IT/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">Příspěvek sdílený UAE Team Emirates🇦🇪 (@uae_team_emirates)</a></p></div></blockquote> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></div><div><br></div><div>V nedávném <a href=\"https://www.magazin.cyklistickey.cz/clanky/plan-na-milano-sanremo-cipressa-pod-9-minut/\" target=\"_blank\">článku</a>&nbsp;jsme rozebírali vyjádření <b>Tima Wellense</b>, který si dělal srandu, že se Cipressa zajede <b>pod 9 minut</b>. V tu chvíli ale ještě netušil, že ze srandy bude realita a Pogačar takový čas <b>skutečně zajede</b>. To vypovídá o závodu jako takovém<b> víc než dost, no ne?&nbsp;</b></div></div></div>    ', 4, 'fenomenalni-zavodeni-s-dechberoucim-koncem-mathieu-van-der-poel-znovu-ovladl-milano-sanremo'),
(810, 'Mistryni evropy to roztáhla mistryně světa! Lorena Wiebes je vítězkou Sanremo Donne!', '2025-03-22 16:50:00', 1, 'Gmpo1itWcAI5qDr.jpg', '\r\n        \r\n        \r\n        Už už to vypadalo, že si pro<b> vavříny na Via Roma</b> dojede domácí <b>Elisa Longo Borghini</b>, ale tým <b>SD Works - Protime</b> řekl <b>ne!</b> Vítězství v ženské variantě italského monumentu Milano-Sanremo patří Nizozemce<b> Loreně Wiebes</b>, která v napínavé koncovce <b>přesprintovala </b>druhou<b> Marianne Vos</b> a třetí <b>Noemi Rüegg</b>.<div><font face=\"Fira Sans Condensed, sans-serif\"><br></font></div><div><font face=\"Fira Sans Condensed, sans-serif\"><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/LuQuzCTZiP0?si=C10zIUektV0Sz7cN\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></font><div><br></div><div><b>156 km</b> dlouhý závod se táhl kolem pobřeží<b> z Janova až do Sanrema</b>. To samozřejmě vybízelo k úniku. Úplně první pokus o něj měla v režii<b> Anne Knijnenburg</b> z VolkerWessels společně s naší <b>Nikolou Noskovou </b>jezdící za <b>Cofidis</b>. Tento pokus byl ale rychle chycen, stejně jako pár dalších, které přišly po něm. Odlepit se od pelotonu se tak povedlo někomu až <b>po dalších 60 kilometrech</b>, kde opět zaútočila<b>&nbsp;Anne Knijnenburg</b>. Té se podařilo ujet samotné a jediný, kdo se jí snažil dohnat byla dvojice&nbsp;<b>Laura Tomasi a Virginia Bortoli</b>. Ztráta balíku na ni činila <b>70 km</b> před cílem asi <b>dvě a půl minuty</b>. Ani Tomasi s Bortoli a ani Knijnenburg se ale nepodařilo náskok udžet <b>déle než dalších 20 km</b>. První a poslední útočnici se podařilo vyjet na vrchol stoupání <b>Capo Mele </b>samotné, aby byla následně ve sjezdu <b>pohlcena</b>.</div><div><br></div><div>V tu chvíli se začalo tempo balíku <b>zvyšovat</b>, když se do toho opřely <b>týmy s favoritkami</b>. Tím způsobený chaos vyústil v <b>hromadnou havárii vpředu</b>, kdy na zemi zůstaly i&nbsp;<b>Pauline Ferrand-Prévot s Lotte Kopecky</b>, za kterou uvázla<b> Lorena Wiebes</b>. Peloton byl tak v nájezdu před Cipressou <b>poměrně roztrhaný</b>. Do nejdelšího kopce dne vyjelo pohromadě asi <b>60 jezdkyň</b>. Nahoře se ale zvedla <b>Pauline Ferrand-Prevot </b>a 13 závodnic, mezi kterými byly všechny favoritky, ve sjezdu&nbsp;<b>odjelo</b>. Nikdo ale kromě <b>Kopecky </b>a <b>Vas</b> nespolupracoval, a tak se po 15 km <b>balík zase sjednotil</b>.</div><div><br></div><div>Do stoupání Poggio vjíždělo závodnic <b>21</b>, ze kterých na konci zbylo už jen <b>12</b>. Ve sjezdu za to vzala <b>Demi Vollering</b>, aby následně pod kopcem zaútočila zezadu<b> Elisa Longo Borghini absolutně na plno</b>. Získala poměrně velký náskok, který by snad i dovezla do cíle. To by ale vzadu nesměla čekat Lotte Kopecky. Ta v duhovém dresu využila svých <b>časovkářských schopností </b>a dovezla skupinku na cílovou rovinku asi <b>10 metrů za Italkou</b>. V tu chvíli začala sprintovat <b>Marianne Vos</b>, která ale nezvládla vydržet na první pozici <b>celých 250 metrů</b>, a tak si Lorena Wiebes, jenž se za ní vyvezla,<b> dojela si pro první místo</b>.</div><div><br></div><div><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/reel/DHgZ23Xspwd/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/reel/DHgZ23Xspwd/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height: