verflow:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/reel/DHgZ23Xspwd/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">Příspěvek sdílený Milano Sanremo (@milanosanremo_)</a></p></div></blockquote> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></div><div><br></div><div><div>\"Cítila jsem, že jsem na tom na Cipresse <b>velmi dobře</b>, takže i na Poggiu jsem byla nahoře <b>v první pětce</b>, a věděla jsem, že <b>jedu pro vítězství</b>. Longo Borghini předvedla <b>hodně nepříjemný útok</b>, ale viděla jsem, že Lotte je těsně za mnou, a jak už jsem řekla, ta práce, kterou následně vynaložila, <b>byla fenomenální</b>. Musím říct, že mě <b>Vos trochu překvapila</b>. Nechtěla jsem svůj sprint začít příliš brzy, ale<b> naštěstí to vítězství stačilo</b>,“ zhodnotila závod <b>první žena</b>.</div></div><div><br></div><div><b>Nikola Nosková dorazila na 65. místě.</b></div><div><br></div><div><i>Kompletní výsledky naleznete&nbsp;<a href=\"https://firstcycling.com/race.php?r=12235&amp;y=2025\" target=\"_blank\"><b>ZDE</b></a>.</i></div><div><br></div><div><b>Rozhodně bylo na co koukat že?</b></div></div>            ', 4, 'mistryni-evropy-to-roztahla-mistryne-sveta-lorena-wiebes-je-vitezkou-sanremo-donne');
